import React, { Component } from "react";
import './body.css'


class Body extends Component
{
    render()
    {
        return(
            <div style={{'background': 'url(https://cropper.watch.aetnd.com/cdn.watch.aetnd.com/sites/2/2018/05/HITH-8-things-you-may-not-know-about-american-money.jpg)'}} className="page-holder bg-cover">

                <div className="container py-5 ">
                    <header className="text-center text-grey py-5 animate__animated animate__fadeInUpBig ">
                        <h1 className="display-1 font-weight-bold mb-4">Wallet As A Service</h1>

                    </header>

                    <header className="text-center text-white py-5 animate__animated animate__fadeInUpBig animate__delay-1s">
                        <h3 className="display-4 font-weight-bold mb-4">Get Started!!!</h3>


                        <a href={"/log"}><button style={{fontSize:'50px'}} className="animate__animated animate__fadeInUpBig  animate__delay-4s btn btn-dark floatleft btn-xxl"  >Log In</button></a>

                        <a href={"/register"}><button style={{fontSize:'50px'}} className="btn btn-dark floatright btn-xxl btn-lg">Register</button></a>

                    </header>
                </div>
                        {/*<div className="card box_shw2 border-0 px-3 rounded-2 mb-3 w_500 py-4 mx-auto mt-5">*/}
            </div>
        )
    }
}
export default Body;
